import React, { useState } from 'react';
import './Navbar.css';
import { NavLink, Redirect } from 'react-router-dom';
import { Modal, Button } from 'antd';
import { modalData, modalData2 } from './data';

const Navbar = ({ sticky }) => {
  const token = localStorage.getItem('tokenWeb');
  const [isModalVisible, setIsModalVisible] = useState(false);
  const [isModalWishList, setIsModaWishList] = useState(false);
  const [isModalLogin, setIsModalLogin] = useState(false);
  const [clickSearch,setClickSearch] = useState(false)
const [isCheckout,setIsCheckout] = useState(false)
  const handleOk = () => {
    setIsModalVisible(false);
    setIsModaWishList(false);
    setIsModalLogin(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
    setIsModaWishList(false);
    setIsModalLogin(false);
  };

  return (

    <div>
      {isCheckout && <Redirect to="/shipping-information" />}
      <nav
        className={
          sticky
            ? 'navbar navbar-sticky navbar-expand-lg'
            : 'navbar navbar-expand-lg'
        }
        style={{ padding: '17px 50px' }}
      >
        {/* <a className="navbar-brand" href="/"> */}
        <NavLink to="/">
          <img
            src="./image/logo/logo.png"
            style={{ width: '155px', height: '32px' }}
            alt="logo"
          />
        </NavLink>

        {/* </a> */}
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon" />
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item active">
              <NavLink to="/store" style={{ color: 'black' }}>
                Shop
              </NavLink>
            </li>
            <li className="nav-item active">
              <NavLink to="/kits" style={{ color: 'black' }}>
                Kits
              </NavLink>
            </li>

            <li className="nav-item active">
              <NavLink to="/about" style={{ color: 'black' }}>
                About
              </NavLink>
            </li>
            <li className="nav-item active">
              <NavLink to="/contact" style={{ color: 'black' }}>
                Contact
              </NavLink>
            </li>
          </ul>
          <ul className="navbar-nav">
          <li
              className="nav-item active menu-left"
              // style={{width: clickSearch && '500px',borderBottom: clickSearch && 'solid 1px black'}}              
              style={{ cursor: 'pointer' }}
            >
              <div  style={{width: clickSearch && '500px',borderBottom: clickSearch && 'solid 1px black'}}>
              <img
              onClick={() => {
                setClickSearch(!clickSearch)
              }}
                src="./image/Home/search.png"
                alt="vector"
                style={{ width: '23px', height: '23px' }}
              />
              </div>

            </li>
            <li className="nav-item active menu-left">
              <NavLink to={token ? '/profile' : '/login'}>
                <img
                  src={
                    token
                      ? './image/Product/productAvt.png'
                      : './image/Home/blackPerson.png'
                  }
                  alt="aphro"
                  style={{ width: '23px', height: '23px' }}
                />
              </NavLink>
            </li>
            <li
              className="nav-item active menu-left"
              onClick={() => {
                setIsModaWishList(true);
                setIsModalVisible(false)
                setIsModalLogin(false)
              }}
              style={{ cursor: 'pointer' }}
            >
              <img
                src="./image/Home/blackHeart.png"
                alt="vector"
                style={{ width: '23px', height: '23px' }}
              />
            </li>
            <li
              className="nav-item active"
              onClick={() => {
                setIsModalVisible(true);
                setIsModaWishList(false)
                setIsModalLogin(false)
              }}
              style={{ cursor: 'pointer' }}
            >
              <img
                src="./image/Home/blackBag.png"
                alt="vector 2"
                style={{ width: '23px', height: '23px' }}
              />
            </li>
          </ul>
        </div>
      </nav>
      <Modal
        title="Shopping Cart"
        visible={isModalVisible}
        onOk={handleOk}
        onCancel={handleCancel}
        cancelButtonProps={{ style: { display: 'none' } }}
        okButtonProps={{ style: { display: 'none' } }}
      >
        <div
          style={{
            display: 'flex',
            flexDirection: 'column',
          }}
        >
          <div style={{ padding: '15px 35px', borderBottom: 'solid 1px #ccc' }}>
            {modalData.map((value, index) => {
              return (
                <div
                  style={{
                    display: 'flex',
                    flexDirection: 'row',
                    alignItems: 'flex-end',
                    marginBottom: index !== modalData.length - 1 && '35px',
                  }}
                  key={index}
                >
                  <div style={{ position: 'relative' }}>
                    <img
                      src={value.image}
                      style={{
                        width: '140px',
                        height: '170px',
                        marginRight: '30px',
                      }}
                      alt="product"
                    />
                    <div
                      style={{
                        width: '18px',
                        height: '18px',
                        borderRadius: '18px',
                        backgroundColor: 'grey',
                        position: 'absolute',
                        right: '20px',
                        top: '-8px',
                        display: 'flex',
                        justifyContent: 'center',
                        alignItems: 'center',
                      }}
                    >
                      <span style={{ color: '#cecece' }}>x</span>
                    </div>
                  </div>

                  <div style={{ display: 'flex', flexDirection: 'column' }}>
                    <p
                      style={{
                        fontWeight: '700',
                        fontFamily: 'Lato',
                        fontSize: '14px',
                      }}
                    >
                      {value.title}
                    </p>
                    <p
                      style={{
                        fontFamily: 'Lato',
                        fontWeight: '300',
                        fontSize: '14px',
                      }}
                    >
                      50ml
                    </p>
                    <p
                      style={{
                        fontFamily: 'Lato',
                        fontWeight: '300',
                        fontSize: '14px',
                      }}
                    >
                      $ 34
                    </p>
                    <div
                      style={{
                        width: '138px',
                        height: '42px',
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'space-between',
                        border: 'solid 1px black',
                        paddingLeft: '10px',
                        paddingRight: '10px',
                      }}
                    >
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        -
                      </span>
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        1
                      </span>
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        +
                      </span>
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
          <div
            style={{
              display: 'flex',
              flexDirection: 'column',
              padding: '21px 30px 50px 30px',
            }}
          >
            <div
              style={{
                display: 'flex',
                flexDirection: 'row',
                justifyContent: 'space-between',
                width: '100%',
              }}
            >
              <p style={{ fontWeight: '600', fontFamily: 'Lato' }}>Subtotal</p>
              <p style={{ fontWeight: '600', fontFamily: 'Lato' }}>$ 102</p>
            </div>
            <p
              style={{
                fontWeight: '300',
                fontFamily: 'Lato',
                marginBottom: '0px',
              }}
            >
              shipping & taxes will be calculated at check out
            </p>
            <div style={{ marginTop: '30px' }}>
              <Button
               className="button-main"
                style={{
                  width: '100%',
                  size: 'large',
                  height: '50px',
                  fontFamily:'Lato'
                }}
                onClick={() => {
                  if (token) {
                    setIsCheckout(true)
                    setIsModaWishList(false);
                    setIsModalVisible(false)
                    setIsModalLogin(false)
                  } else {
                    setIsModaWishList(false);
                    setIsModalVisible(false)
                    setIsModalLogin(true);
                  }
                }}
              >
                Submit
              </Button>
            </div>
            <div style={{ marginTop: '39px' }}>
              <div
                style={{
                  display: 'flex',
                  flexDirection: 'row',
                  alignItems: 'flex-end',
                }}
              >
                <img
                  src="./image/modal/modal1.png"
                  style={{
                    width: '140px',
                    height: '170px',
                    marginRight: '30px',
                  }}
                  alt="product"
                />

                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <p
                    style={{
                      fontWeight: '700',
                      fontFamily: 'Lato',
                      fontSize: '14px',
                    }}
                  >
                    APHRO the pearly goddess foaming cleanser
                  </p>
                  <p
                    style={{
                      fontFamily: 'Lato',
                      fontWeight: '300',
                      fontSize: '14px',
                    }}
                  >
                    50ml
                  </p>
                  <p
                    style={{
                      fontFamily: 'Lato',
                      fontWeight: '300',
                      fontSize: '14px',
                    }}
                  >
                    $ 34
                  </p>
                  <div
                    style={{
                      width: '138px',
                      height: '42px',
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'space-between',
                      border: 'solid 1px black',
                      paddingLeft: '10px',
                      paddingRight: '10px',
                    }}
                  >
                    <span style={{ fontWeight: '700', fontSize: '14px' }}>
                      -
                    </span>
                    <span style={{ fontWeight: '700', fontSize: '14px' }}>
                      1
                    </span>
                    <span style={{ fontWeight: '700', fontSize: '14px' }}>
                      +
                    </span>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </Modal>

      <Modal
        title="Wishlist"
        visible={isModalWishList}
        onOk={handleOk}
        onCancel={handleCancel}
        cancelButtonProps={{ style: { display: 'none' } }}
        okButtonProps={{ style: { display: 'none' } }}
      >
        <div
          style={{
            display: 'flex',
            flexDirection: 'column',
          }}
        >
          <div style={{ padding: '15px 35px', borderBottom: 'solid 1px #ccc' }}>
            {modalData2.map((value, index) => {
              return (
                <div
                  style={{
                    display: 'flex',
                    flexDirection: 'row',
                    marginBottom: index !== modalData.length - 1 && '35px',
                  }}
                  key={index}
                >
                  <div style={{ position: 'relative' }}>
                    <img
                      src={value.image}
                      style={{
                        width: '140px',
                        height: '170px',
                        marginRight: '30px',
                      }}
                      alt="product"
                    />
                    <div
                      style={{
                        width: '18px',
                        height: '18px',
                        borderRadius: '18px',
                        backgroundColor: 'grey',
                        position: 'absolute',
                        right: '20px',
                        top: '-8px',
                        display: 'flex',
                        justifyContent: 'center',
                        alignItems: 'center',
                      }}
                    >
                      <span style={{ color: '#cecece' }}>x</span>
                    </div>
                  </div>

                  <div style={{ display: 'flex', flexDirection: 'column' }}>
                    <p
                      style={{
                        fontWeight: '700',
                        fontFamily: 'Lato',
                        fontSize: '14px',
                      }}
                    >
                      {value.title}
                    </p>
                    <p
                      style={{
                        fontFamily: 'Lato',
                        fontWeight: '300',
                        fontSize: '14px',
                      }}
                    >
                      50ml
                    </p>
                    <p
                      style={{
                        fontFamily: 'Lato',
                        fontWeight: '300',
                        fontSize: '14px',
                      }}
                    >
                      $ 34
                    </p>
                    <div
                      style={{
                        width: '138px',
                        height: '42px',
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'space-between',
                        border: 'solid 1px black',
                        paddingLeft: '10px',
                        paddingRight: '10px',
                      }}
                    >
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        -
                      </span>
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        1
                      </span>
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        +
                      </span>
                    </div>
                  </div>
                  <div style={{ marginTop: '5px', marginLeft: '10px' }}>
                    {value.tick ? (
                      <img
                        style={{ width: '18px', height: '18px' }}
                        src="./image/modal/modaltick.png"
                        alt="modal tick"
                      />
                    ) : (
                      <div
                        style={{
                          width: '18px',
                          height: '18px',
                          border: 'solid 1px grey',
                        }}
                      ></div>
                    )}
                  </div>
                </div>
              );
            })}
          </div>
          <div
            style={{
              display: 'flex',
              flexDirection: 'column',
              padding: '21px 30px 50px 30px',
            }}
          >
            <p
              style={{
                fontWeight: '300',
                fontFamily: 'Lato',
                marginBottom: '0px',
              }}
            >
              Selected (3) items
            </p>
            <div style={{ marginTop: '30px' }}>
              <Button
               className="button-main"
                style={{
                  width: '100%',
                  fontFamily:'Lato',
                  size: 'large',
                  height: '50px',
                }}
              >
